import React from 'react';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns'; // Make sure this is imported

const AnxietyRiskChart = ({ 
    title, 
    data, 
    threshold, 
    baseRatio, 
    periodLabel, 
    ageGroup,
    description 
}) => {
    // Ensure data is properly formatted with valid dates
    const validData = data?.filter(point => 
        point.x instanceof Date && !isNaN(point.x) && 
        typeof point.y === 'number'
    ) || [];

    const chartData = {
        datasets: [{
            label: 'PM2.5 Levels',
            data: validData,
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1
        }]
    };

    const chartOptions = {
        responsive: true,
        maintainAspectRatio: false,
        scales: {
            x: {
                type: 'time',
                time: {
                    unit: 'day',
                    displayFormats: {
                        day: 'MMM d'
                    }
                },
                title: {
                    display: true,
                    text: 'Date'
                }
            },
            y: {
                title: {
                    display: true,
                    text: 'PM2.5 (μg/m³)'
                }
            }
        },
        plugins: {
            title: {
                display: true,
                text: title
            },
            tooltip: {
                callbacks: {
                    afterBody: (tooltipItems) => {
                        return [
                            `Threshold: ${threshold} μg/m³`,
                            `Base Ratio: ${baseRatio}`,
                            `Period: ${periodLabel}`,
                            description ? `Note: ${description}` : ''
                        ].filter(Boolean);
                    }
                }
            }
        }
    };

    return (
        <div className="risk-chart-container">
            <h3>{title}</h3>
            <p className="age-notice">Results applicable for {ageGroup}</p>
            <p className="period-notice">Based on {periodLabel} measurements</p>
            <div style={{ height: '300px' }}>
                <Line data={chartData} options={chartOptions} />
            </div>
        </div>
    );
};

export default AnxietyRiskChart;
